import './App.css';
import BrowserRouter, { Route } from 'react-router-dom';
import Home from './Pages/Home.js'

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Routes>
        <Route path='/' element={<Home/>}></Route>
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
